class Solution:
    def __init__(self):
        self.T_g = 0
        self.T_y = 0
        self.T_r = 0
        self.observations = []

    def get_probability(self, t_q, c_q):
        green_probability = 0
        yellow_probability = 0
        red_probability = 0
        for observation in self.observations:
            time, color = observation
            if time == t_q and color == c_q:
                return 1.0
            if time <= t_q:
                if color == "green":
                    green_probability += 1
                elif color == "yellow":
                    yellow_probability += 1
                elif color == "red":
                    red_probability += 1
            else:
                break

        total_states = (green_probability + yellow_probability + red_probability)
        if c_q == "green":
            return green_probability / total_states
        elif c_q == "yellow":
            return yellow_probability / total_states
        elif c_q == "red":
            return red_probability / total_states

    def solve(self, stdin: str) -> str:
        lines = stdin.split("\n")
        self.T_g, self.T_y, self.T_r = map(int, lines[0].split())
        n = int(lines[1])
        self.observations = []

        for i in range(2, n+2):
            time, color = map(str, lines[i].split())
            self.observations.append((int(time), color))

        t_q, c_q = map(str, lines[-1].split())
        t_q, c_q = int(t_q), c_q
        return self.get_probability(t_q, c_q)

