class Solution:
    def solution(self, input: str) -> str:
        n, stones = input.split("\n")
        stones = [int(i) for i in stones.split()]

        def sjfnb_move(stones):
            if stones == []:
                return True, None
            for i in range(len(stones)):
                if stones[i] > 0:
                    stones[i] -= 1
                    if not sjfnb_move(stones):
                        stones[i] += 1
                        return True, None
                    stones[i] += 1
            return False, stones

        def cslnb_move(stones):
            if stones == []:
                return True, None
            for i in range(len(stones)):
                if stones[i] > 0:
                    stones[i] -= 1
                    if not cslnb_move(stones):
                        stones[i] += 1
                        return True, None
                    stones[i] += 1
            return False, stones

        stones_sjfnb, stones_cslnb = [], []
        for i in range(len(stones)):
            if stones[i] > 0:
                stones_sjfnb.append(stones[i])
            else:
                stones_cslnb.append(stones[i])

        def sjfnb_is_winner(stones):
            for i in range(len(stones)):
                if stones[i] > 0:
                    stones[i] -= 1
                    if not sjfnb_is_winner(stones):
                        stones[i] += 1
                        return False
                    stones[i] += 1
            return True

        def cslnb_is_winner(stones):
            for i in range(len(stones)):
                if stones[i] > 0:
                    stones[i] -= 1
                    if not cslnb_is_winner(stones):
                        stones[i] += 1
                        return False
                    stones[i] += 1
            return True

        if sjfnb_is_winner(stones_sjfnb) and not cslnb_is_winner(stones_cslnb):
            return "sjfnb"
        else:
            return "cslnb"

