class Solution:
    def solution(self, n: int, a: List[int]) -> str:
        for i in range(n):
            if a[i] == 0:
                if i == 0:
                    return "cslnb"
                else:
                    return "sjfnb"
            for j in range(i+1, n):
                if a[i] == a[j]:
                    return "sjfnb" if i % 2 == 0 else "cslnb"
        return "sjfnb" if n % 2 == 0 else "cslnb"

    def solution_test(self, n: int, a: List[int]) -> str:
        return self.solution(n, a)

